-- schema
CREATE SCHEMA D24;

-- table
CREATE TABLE D24.selection (
    id_selection  INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    Tour          INTEGER,
    Choix         INTEGER,
    Équipe        VARCHAR (500),
    Joueur        VARCHAR (500),
    Poste         VARCHAR (500),
    Université    VARCHAR (500),
    Conférence    VARCHAR (500),
    Poste_nom     VARCHAR (500),
    Groupe_poste  VARCHAR (500),
    Groupe_conf   VARCHAR (500)
    );

